import React, { useState, useEffect } from "react";
import axios from "axios";
import {
  TextField,
  Card,
  CardContent,
  Typography,
  CircularProgress,
  Dialog,
  DialogTitle,
  DialogContent,
  Button,
  Grid,
} from "@mui/material";
import { motion } from "framer-motion";

const App = () => {
  const [places, setPlaces] = useState([]);
  const [loading, setLoading] = useState(false);
  const [selectedPlace, setSelectedPlace] = useState(null);
  const [filter, setFilter] = useState("");

  const fetchPlaces = async (lat, lng, type = "") => {
    setLoading(true);
    try {
      const response = await axios.get(
        `http://localhost:5000/api/places?lat=${lat}&lng=${lng}&type=${type}`
      );
      setPlaces(response.data.results);
    } catch (error) {
      console.error("Error fetching places:", error);
    }
    setLoading(false);
  };

  const getUserLocation = () => {
    if (navigator.geolocation) {
      navigator.geolocation.getCurrentPosition(
        (position) => {
          const { latitude, longitude } = position.coords;
          fetchPlaces(latitude, longitude, filter);
        },
        (error) => {
          console.error("Geolocation error:", error);
          alert("Could not get your location. Please enable location services.");
        }
      );
    } else {
      alert("Geolocation is not supported by this browser.");
    }
  };

  useEffect(() => {
    getUserLocation();
  }, [filter]);

  const handleCardClick = (place) => {
    setSelectedPlace(place);
  };

  const handleClose = () => {
    setSelectedPlace(null);
  };

  return (
    <div style={{ minHeight: "100vh", background: "#f9f9f9", padding: "2rem" }}>
      <Typography variant="h3" align="center" gutterBottom>
        üåç Local Explorer
      </Typography>
      <Typography variant="body1" align="center" color="textSecondary" gutterBottom>
        Discover nearby places and reviews
      </Typography>

      <div style={{ display: "flex", justifyContent: "center", margin: "1rem 0" }}>
        <Button
          variant={filter === "" ? "contained" : "outlined"}
          onClick={() => setFilter("")}
          style={{ margin: "0 0.5rem" }}
        >
          All
        </Button>
        <Button
          variant={filter === "school" ? "contained" : "outlined"}
          onClick={() => setFilter("school")}
          style={{ margin: "0 0.5rem" }}
        >
          üè´ Schools
        </Button>
        <Button
          variant={filter === "hospital" ? "contained" : "outlined"}
          onClick={() => setFilter("hospital")}
          style={{ margin: "0 0.5rem" }}
        >
          üè• Hospitals
        </Button>
        <Button
          variant={filter === "movie_theater" ? "contained" : "outlined"}
          onClick={() => setFilter("movie_theater")}
          style={{ margin: "0 0.5rem" }}
        >
          üé¨ Theaters
        </Button>
      </div>

      {loading ? (
        <div style={{ display: "flex", justifyContent: "center", marginTop: "3rem" }}>
          <CircularProgress size={60} />
        </div>
      ) : (
        <Grid container spacing={3}>
          {places.map((place, idx) => (
            <Grid item xs={12} sm={6} md={4} key={idx}>
              <motion.div
                initial={{ opacity: 0, y: 20 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ delay: idx * 0.05 }}
              >
                <Card
                  style={{
                    borderRadius: 16,
                    boxShadow: "0 6px 20px rgba(0,0,0,0.2)",
                    cursor: "pointer",
                  }}
                  onClick={() => handleCardClick(place)}
                >
                  <img
                    src={
                      place.photos
                        ? `https://maps.googleapis.com/maps/api/place/photo?maxwidth=400&photoreference=${place.photos[0].photo_reference}&key=AIzaSyB3PgI153B24mtSoJvKSjCPQyEyDQqu3K8`
                        : "https://via.placeholder.com/400x300?text=No+Image"
                    }
                    alt={place.name}
                    style={{
                      width: "100%",
                      height: 200,
                      objectFit: "cover",
                      borderTopLeftRadius: 16,
                      borderTopRightRadius: 16,
                    }}
                    onError={(e) => {
                      e.target.src = "https://via.placeholder.com/400x300?text=No+Image";
                    }}
                  />
                  <CardContent>
                    <Typography variant="h6">{place.name}</Typography>
                    <Typography variant="body2" color="textSecondary">
                      {place.vicinity || place.formatted_address}
                    </Typography>
                  </CardContent>
                </Card>
              </motion.div>
            </Grid>
          ))}
        </Grid>
      )}

      <Dialog open={!!selectedPlace} onClose={handleClose} fullWidth maxWidth="sm">
        <DialogTitle>{selectedPlace?.name}</DialogTitle>
        <DialogContent>
          <Typography variant="body1" gutterBottom>
            Address: {selectedPlace?.formatted_address || selectedPlace?.vicinity}
          </Typography>
          <Typography variant="body2" color="textSecondary" gutterBottom>
            Reviews:
          </Typography>
          <ul>
            {selectedPlace?.reviews
              ? selectedPlace.reviews.map((review, index) => (
                  <li key={index}>
                    <strong>{review.author_name}:</strong> {review.text}
                  </li>
                ))
              : "No reviews available."}
          </ul>
        </DialogContent>
        <Button
          onClick={handleClose}
          style={{ margin: "1rem" }}
          variant="contained"
          color="primary"
        >
          Close
        </Button>
      </Dialog>
    </div>
  );
};

export default App;
